AlienPresale.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

interface IERC20 {
    function transfer(address to, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract AlienPresale {
    address public owner;
    IERC20 public alienToken;
    uint256 public rate; // Кол-во ALIEN за 1 MATIC
    uint256 public minPurchase; // Минимальная покупка в wei
    uint256 public maxPurchase; // Максимальная покупка в wei
    uint256 public presaleCap; // Максимум ALIEN для продажи
    uint256 public soldTokens; // Сколько ALIEN уже продано
    bool public isPaused;

    event TokensPurchased(address indexed buyer, uint256 maticAmount, uint256 alienAmount);
    event Paused(bool status);
    event RateChanged(uint256 newRate);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    modifier whenNotPaused() {
        require(!isPaused, "Presale paused");
        _;
    }

    constructor(address _alienToken, uint256 _rate, uint256 _minPurchase, uint256 _maxPurchase, uint256 _presaleCap) {
        owner = msg.sender;
        alienToken = IERC20(_alienToken);
        rate = _rate;
        minPurchase = _minPurchase;
        maxPurchase = _maxPurchase;
        presaleCap = _presaleCap;
    }

    receive() external payable {
        buyTokens();
    }

    function buyTokens() public payable whenNotPaused {
        require(msg.value >= minPurchase, "Below minimum purchase");
        require(msg.value <= maxPurchase, "Above maximum purchase");

        uint256 tokenAmount = msg.value * rate;
        require(soldTokens + tokenAmount <= presaleCap, "Presale cap reached");
        require(alienToken.balanceOf(address(this)) >= tokenAmount, "Not enough tokens in contract");

        soldTokens += tokenAmount;

        (bool sent, ) = owner.call{value: msg.value}("");
        require(sent, "Failed to send MATIC");

        alienToken.transfer(msg.sender, tokenAmount);

        emit TokensPurchased(msg.sender, msg.value, tokenAmount);
    }

    function pausePresale() external onlyOwner {
        isPaused = true;
        emit Paused(true);
    }

    function unpausePresale() external onlyOwner {
        isPaused = false;
        emit Paused(false);
    }

    function changeRate(uint256 newRate) external onlyOwner {
        rate = newRate;
        emit RateChanged(newRate);
    }

    function withdrawTokens(uint256 amount) external onlyOwner {
        alienToken.transfer(owner, amount);
    }
}

